import React from "react";

const AddForm = () => {
  return (
    <tr>
      <td>
        <input type="text" />
      </td>
      <td>
        <select>
          <option value="男"/>
          <option value="女"/>
        </select>
      </td>
      <td>
        <input type="text" />
      </td>
      <td>
        <input type="text" />
      </td>
      <td>
        <button>添加</button>
      </td>
    </tr>
  );
};

export default AddForm;
